import * as React from "react";

import {
  control, //name spaces
  Controls, //group
  Map
} from "react-openlayers";

export default class FullScreen extends React.Component<any, any> {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Map>
          <Controls>
            <control.FullScreen />
          </Controls>
        </Map>
      </div>
    );
  }
}
